property.code:
var XWiki = (function(XWiki) {
  var init = function(event) {
    ((event && event.memo.elements) || [$('body')]).each(function(element) {
      element.select("input[type='text'].required").each(function(element) {
        if (!element.__validation) {
          element.__validation = new LiveValidation(element, {validMessage: '', wait : 500});
        }
        element.__validation.add(Validate.Presence, {failureMessage: 'Please enter a value'});
      });
      $('email').__validation.add(Validate.Email, {failureMessage: 'Please enter a valid email address'});
    });
    return true;
  };

  (XWiki.domIsLoaded && init()) || document.observe("xwiki:dom:loaded", init);
  document.observe("xwiki:dom:updated", init);

  // End XWiki augmentation.
  return XWiki;
}(XWiki || {}));

